Per cominciare ad usare jQuery, dobbiamo inizializzare la libreria. Andiamo sul nostro file JavaScript e aggiungiamo il seguente snippet di codice. var init = function() { alert("JS test with Jquery");
} $(document).ready(init); Vediamo in dettaglio cosa abbiamo fatto. Partiamo dall'ultima riga. $(document).ready(init); Il simbolo $ √® il nome della variabile oggetto messa a disposizione dalla libreria jQuery. In JavaScript infatti, il dollaro √® un carattere valido per l'inizio di una nome di una variabile o funzione. jQuery mette a disposizione solo la variabile $ . Pubblicare una sola variabile √® una cosa molto comune in JavaScript, come vedremo. La variabile document √® invece messa a disposizione dal browser e contiene tutte le informazioni che riguarda la pagina html e i relativi fogli di stile CSS. √à il nostro punto di contatto tra l'html e gli script JavaScript. L'espressione $(document) serve a inizializzare la libreria jQuery con il documento corrente. In questo modo inoltre jQuery prende il controllo del documento, e noi non andremo mai pi√π ad usare la variabile document direttamente, ma passeremo sempre attraverso l'oggetto $() . Immediatamente dopo l'inizializzazione viene chiamato il metodo .ready() , che richiede come parametro una funzione . Passare come parametri funzioni √® una cosa estremamente comune in JavaScript, e anche noi la useremo estensivamente. Il metodo ready invocher√† la funzione passatagli come parametro, nel nostro caso init , quando il caricamento della pagina sar√† completo e quindi saremo pronti per il processamento del documento. Vediamo ora come abbiamo dichiarato la funzione init . var init = function() { alert("JS test with Jquery");
} Facciamo particolare attenzione a questa sintassi. Abbiamo dichiarato la variabile init , ed abbiamo usato l'operatore di assegnazione (il simbolo = ) per assegnarli come valore una funzione. In questo modo abbiamo di fatto creato una variabile che pu√≤ essere invocata come una funzione (ovvero con le parentesi tonde, init() ). La funzione dichiarata in questo modo non ha un nome suo, infatti non c'√® nessun identificativo fra la keyword function e le parentesi tonde che seguono. Questo tipo di funzioni si chiamano anonime , in inglese anonymous-functions . Chi vuole approfondire pu√≤ leggere questo articolo . Se ora ricarichiamo la pagina, otteniamo un comportamento molto simile al procedente.

