Prima di andare avanti, √® bene impostare correttamente il file JavaScript. Questo linguaggio infatti lascia moltissima libert√† ai programmatori nell'organizzazione del codice, e questa √® una buona cosa perch√© √® possibile creare librerie e framework molto potenti, ma senza un po' di disciplina si finsce con lo scrivere del codice che √® completamente non mantenibile e soggetto ad infiniti tipi di bug. Rimandiamo al link all'inizio di questa pagina per una syle-guide. Fate particolare attenzione quando copiate-incollate codice da Internet. Assicuratevi che sia scritto bene, e che segua le vostre convenzioni. Alcune stime non ufficiali dicono che l'80% del codice JavaScript reperibile su Internet √® monnezza, quindi state in guardia. Per cominciare, bisogna sapere che le variabili in JavaScript dichiarate con var hanno uno scope di funzione , ovvero sono visibili in tutta la funzione in cui sono state dichiarate, indipendentemente dal file o dal blocco in cui si trovano . Cosa significa in pratica? Significa che i seguenti due snippet di codice sono equivalenti: function() { var myName = "Harry"; if (myName == "Harry") { var myFriend = "Ron"; alert("myFriend name is "+ myFriend); }
} function() { var myName = "Harry"; var myFriend = "Ron"; if (myName == "Harry") { alert("myFriend name is "+ myFriend); }
} Come vedete, la variabile myFriend √® salita fino in cima alla funzione, uscendo dallo scope dell' if da cui era definita. Questo √® un comportamento inusuale, rispetto ad altri linguaggi, e potenzialmente rischioso! Infatti si rischia un conflitto di nomi tra variabili dichiarate anche lontano fra loro. Questo comportamento si chiama hoisting . Vedi la documentazione ufficiale per dettagli. La cosa √® particolarmente pericolosa se si dichiarano variabili al di fuori di tutte le funzioni. Cosa succede in questo caso? Le variabili vanno a finire nella funzione globale del browser, che si chiama window() . Come sappiamo, le variabili globali sono estremamente pericolose perch√© potrebbero andare in conflitto in qualsiasi momento e in modo imprevedibile con altre variabili dichiarate chiss√† dove, da noi o da altre librerie. Per evitare il pi√π possibile di usare variabili globali, ci sono varie strategie. Noi ne useremo una semplice e molto diffusa: dichiariamo un unica variabile globale con lo stesso nome del file mettiamo tutte le variabili (stringhe, numeri, funzioni e altri oggetti) come propriet√† e metodi di questo oggetto Se avete fatto attenzione, questo √® anche il metodo usato da jQuery con la sua variabile $ .

