Creiamo quindi il nostro oggetto globale. Per dichiarare un oggetto in JavaScript si usano le parentesi graffe. Un oggetto vuoto √® quindi dichiarato cos√¨: var app = {}; Ogni propriet√† e metodo all'interno dell'oggetto viene dichiarato con la sintassi nome:valore . Se vogliamo dichiarare ed assegnare la nostra funzione init all'interno di questo oggetto, la sintassi quindi sar√† la seguente. var app = { init: function() { alert("JS test with Jquery"); }
}; A questo punto il nostro file app.js avr√† il seguente aspetto. var app = { init: function() { alert("JS test with Jquery"); }
}; $(document).ready(app.init); Notiamo che all'interno del metodo ready abbiamo messo ora app.init . Questo perch√© la variabile init non √® pi√π visibile dallo scope gloale, e dobbiamo quindi richiamarla all'interno dell'oggetto app . Attenzione: non confondete le notazioni app.init (senza parentesi) e app.init() (con le parentesi). La prima notazione √® la variabile che contiene la funzione: quando l'usate, la funzione stessa non viene richiamata. La funzione verr√† realmente chiamata solo quando il documento √® effettivamente pronto. Con la notazione app.init() invece noi stiamo chiamando la funzione, e passiamo alla funzione ready il valore di ritorno della funzione app.init . Siccome nel nostro caso la funzione init non ritorna nessun valore, verr√† passato il valore undefined , che √® una keyword del linguaggio ed un valore speciale. Provare per credere.

